export const refreshProductTemplate = async (productTemplateId: number, productsTemplate: ProductsTemplate): Promise<ProductsTemplate> => {
  await new Promise(resolve => {
    setTimeout(() => {
      resolve()
    }, 500);
  })
  return {
    id: productTemplateId,
    channels: [],
    description: productsTemplate.description,
    name: productsTemplate.name,
    image: productsTemplate.image,
    productsAmount: 84,
    scanAmount: 42,
  }
}

export const createProductsTemplate = (productsTemplate: ProductsTemplate): ProductsTemplate => {
  const id = 5 + Math.floor(100*Math.random())
  return {
    id: id,
    channels: [],
    description: productsTemplate.description,
    name: productsTemplate.name,
    image: productsTemplate.image,
    productsAmount: 84,
    scanAmount: 42,
  }
}

